('028341f8-1def-4285-8a4a-d86671d9272b', 'Căn hộ FULL nội thất máy giặt riêng- máy lạnh mới', '3', 'CNNB', 'Địa chỉ: 74 Đường Cộng Hòa, Phường 13, Quận Tân Bình, Hồ Chí Minh', '977cf405-b1d7-40da-938e-6e5e3b515113', 'CTCH', '[\" Căn hộ FULL nội thất máy giặt riêng- máy lạnh mới\",\"( Ngay phía sau ILA Cộng Hòa, cách mặt tiền Cộng hòa 20m)\",\"Qua học viện hàng không, Đại học Maketing... 5p\",\"Khu vực an ninh, camera, trường mẫu giáo tiểu học kế bên\",\"Phòng tương tự ảnh, tolet riêng, máy lạnh, máy giặt riêng, máy sấy chung, tủ lạnh tủ quần áo , kệ bếp , bàn ghế làm việc, giường nệm ……\",\"Giờ giấc tự do\",\"Lh 0945005128\"]', '4b9454dc-c912-4a9d-ac8d-4174b486afff', '8d31c8de-35e3-4893-b423-8be5ff5e7881', '7cf4f037-f6e8-442c-a656-87d559e21376', '2023-09-11 02:17:44', '2023-09-11 02:17:44'),
('03ec58b7-9462-47a7-92bb-5097037b228f', 'Cho thuê phòng mới diện tích 35m2, giá 5tr/tháng có sẵn đầy đủ nội thất', '5', 'CQP2', 'Địa chỉ: Đường số 61, Phường Thạnh Mỹ Lợi, Quận 2, Hồ Chí Minh', 'ae51b3a9-204c-46d8-b608-bb689b325673', 'CTPT', '[\"Mình cần cho thuê phòng mới diện tích 32m2, giá 5tr/tháng có sẵn nội thất cơ bản\",\"Địa chỉ: 17 Đường số 61, Phường Thạnh Mỹ Lợi, Quận 2, Hồ Chí Minh\",\"- Giá cho thuê: 5tr/tháng\",\"- Có sẵn nội thất cơ bản: Giường, Tủ, Máy lạnh\",\"- Có chỗ nấu ăn\",\"- Có hầm để xe miễn phí\",\"- Có thang máy.\",\"- Điện: 4k/kg, nước 20k/khối\",\"- Internet free siêu mạnh.\"]', 'fde6a62c-63ab-4850-9afb-90417464575a', 'f9f10a8c-5176-44e4-9ba0-d45cbde5f9d8', '33898d52-6f9f-470f-b5a9-a59208b88bde', '2023-09-11 02:19:21', '2023-09-11 02:19:21'),
('05727d26-bd73-4882-976c-29809de33efb', 'Cho thuê mặt bằng trung tâm Quận 3, đường lớn, thích hợp Office, cafe, spa - massage. Chỉ 15tr/tháng', '2', 'CHTU', 'Địa chỉ: 27 Đường Nguyễn Văn Mai, Phường Võ Thị Sáu, Quận 3, Hồ Chí Minh', '97bc039b-eb54-4505-8628-9a7982dbd98b', 'CTMB', '[\"Cho Thuê Đa Dạng Diện Tích: Văn Phòng, Cửa Hàng, Mặt Bằng, Quán Cafe, Spa,...\",\"Thông Tin Chi Tiết:\",\"Địa Chỉ: 27 Nguyễn Văn Mai, Phường Võ Thị Sáu, Quận 3.\",\"Vị Trí Thuận Lợi: Tiếp giáp với Hai Bà Trưng và gần chợ Tân Định, Quận 1 (chỉ cách đường Hai Bà Trưng 30m).\",\"Lối Đi Riêng: Có lối đi riêng.\",\"Giá Thuê: 15.000.000 Đồng/tháng.\",\"Yêu Cầu Cọc: 2 tháng tiền thuê.\",\"Tiện Nghi Đã Có: Đã trang bị máy lạnh và có phòng ngủ riêng thuận tiện cho việc ở lại.\",\"Toilet Riêng: Có toilet riêng.\",\"Tiện Lợi Giao Thông: Đường 2 chiều, phù hợp cho xe ô tô và xe tải qua lại.\",\"Liên Hệ Ngay: Vui lòng liên hệ qua số điện thoại để biết thêm chi tiết và xem nơi cho thuê.\",\" \",\" \"]', '1ee21488-4caf-4ab4-ae29-0ea25b3b10e1', 'fe69a54f-2b9c-421d-9aa4-6cc9c69a0e0c', '523368bf-b591-40fe-9fc9-2d966f687a3e', '2023-09-11 02:18:21', '2023-09-11 02:18:21'),
('08e2adc6-9d79-4426-aa92-8258e4463062', 'Siêu hiếm! Chính chủ cho thuê nhà nguyên căn, giá rẻ, HXH, DT 79m2', '2', 'CNHH', 'Địa chỉ: Đường Phạm Văn Bạch, Phường 15, Quận Tân Bình, Hồ Chí Minh', '50cdea98-9850-4b82-b311-f3c48a56e2d3', 'NCT', '[\"Nhà 1 trệt 1 lầu hẻm ô tô, DT: 79m2\",\"+ Nằm trên đường Phạm Văn Bạch đắt giá nhất Phường 15, Q. Tân Bình, khu vực kinh doanh sầm uất, hàng quán, khách sạn, tòa nhà văn phòng.\",\"+ Cách 30m ra mặt tiền lớn rất thích hợp ở gia đình vừa kinh doanh online, hoặc làm văn phòng Công ty.\",\"+ Vị trí giao thông thuận tiện đi lại các khu vực khác, sân bay đối diện, kinh doanh đỉnh cao, gần E - Town Cộng Hòa, siêu thị Pandora, Aeon Mall Tân Phú, Coop Mart, gần chợ Phạm Văn Bạch, sân golf Tân Sơn, chợ Tân Trụ, chung cư Rubi Garden, khu công nghiệp Tân Bình, trường học các cấp, ra đường Trường Chinh 100m… Xung quanh nhiều tiện ích,\",\"+ Khu an ninh rất tốt, có camera, kế bên là nhà của công an phường, sạch sẽ, thông thoáng.\",\"+ Nhà Nở hậu tài lộc, làm ăn phát đạt.\",\"+ Nhà hướng đông nam rất mát.\",\"Gọi mình ngay nhé !!!!!!!\"]', '9473c3b1-b441-4d09-ba0e-e83276157ef5', '58b7b54d-8813-4650-9162-2794122c3d9a', 'c6351cf0-3dae-4d79-a526-f371dd7d5a6c', '2023-09-11 02:20:04', '2023-09-11 02:20:04'),
('09963863-9841-40eb-b15b-147c330b0b5c', 'Cho thuê phòng trọ dạng chung cư mini máy lạnh Q.8 gần Đại lộ Đông Tây, Q.5, Q.6', '5', 'CQP8', 'Địa chỉ: 154/21-154/23 Đường Hoàng Ngân P.16, Quận 8', 'cece531e-c932-4224-b1b8-c324d6272267', 'CTPT', '[\"Cho thuê phòng trọ dạng chung cư mini P.16, Q.8, gần đại lộ Đông Tây, q5, q6. Phòng thoáng mát, yên tĩnh, có bếp, nhà vệ sinh riêng, cáp quang, wifi miễn phí, có gác đúc, đặt biệt có máy lạnh.\",\"Có camera quan sát tất cả các tầng và nhà xe.\",\"Diện tích sử dụng từ 18-22 m2.Giá từ 1.800.000 đến 2.100.000 đồng.\",\"Địa chỉ: 154/21-154/23 Hoàng Ngân (Đường 41, Phú Định cũ), P.16, Q.8, gần giao lộ Võ Văn Kiệt (đại lộ Đông Tây) và đường An Dương Vương.\",\"LH : Chị Hồng 0379747974\",\"hoặc 0986.726.726\"]', '12253994-7b03-4dfd-9040-df36eec7a3c6', 'bc087942-2c83-4b59-bbf8-50ab6b8a8c1d', '39631662-b7d3-4cdb-b4ec-c834154e5f1c', '2023-09-11 02:19:21', '2023-09-11 02:19:21'),
('0dbd04cb-0d3d-4155-a169-d6753391979d', 'Cho thuê nhà nguyên căn hẻm 28 Tam Bình, TĐ', '0', 'CHNC', 'Địa chỉ: 28 Đường Tam Bình, Phường Hiệp Bình Chánh, Quận Thủ Đức, Hồ Chí Minh', '4ba75ea9-c004-420e-8f1d-d64c003b5e17', 'NCT', '[\"Cho thuê nhà nguyên căn Hẻm 28, Đường Tam Bình, Hiệp Bình Chánh\",\"Giá thuê : 6tr5/tháng\",\"Diện tích : 5x13\",\"Kết cấu : 2PN, 2WC\",\"Hướng : Đông Nam\",\"Hợp đồng 1 năm, cọc 1 tháng\",\"Liên hệ Hoàng Sinh để biết thêm chi tiết.\",\" \"]', 'f03231ee-e09e-47d9-923b-3e80dc02592a', 'b6b4d8d7-84f1-4283-8b6f-e4ee52c3c599', '211dab93-20c3-4a87-a83b-56644051bcdf', '2023-09-11 02:20:04', '2023-09-11 02:20:04'),
