('91942232-8826-458f-8c6a-6f2beef8a4f6', 'Cho thuê mặt bằng 40m2 MẶT TIỀN Lạc Long Quân', '0', 'COBA', 'Địa chỉ: 373 Đường Lạc Long Quân, Phường 5, Quận 11, Hồ Chí Minh', '5e9d3fb5-5573-4257-bbd5-457c152d88c0', 'CTMB', '[\"Phòng Học Cho Thuê Đa Năng - Đầy Đủ Tiện Nghi\",\"***Thông Tin Phòng Học:\",\"- Diện tích: 40m².\",\"- Phòng học được trang bị đầy đủ tiện nghi hỗ trợ cho việc dạy học.\",\"- TiVi, máy lạnh, bàn ghế cho giáo viên và học sinh, bảng trắng,... đã sẵn sàng.\",\"- Phòng học mới, khang trang, có thể thuê theo tháng hoặc theo giờ.\",\"- Có 2 tùy chọn để lựa chọn: phòng có nội thất giảng dạy cơ bản hoặc bạn có thể tự trang trí\",\"- Tận dụng tối ưu hóa diện tích để tạo không gian thoải mái.\",\"- Vị trí nằm ngay mặt tiền đường Lạc Long Quân.\",\"- Miễn phí wifi, máy lạnh, nhà vệ sinh sạch sẽ.\",\"- Khu vực yên tĩnh, an ninh tốt, có chỗ để xe trong và ngoài tòa nhà\",\"- Có thể thuê theo giờ hoặc theo tháng.\",\"- Mức giá: 110.000 đồng/giờ hoặc thuê theo tháng.\",\"- Phòng học đã sẵn sàng, có thể mở lớp dạy ngay.\",\" \"]', '083b17ae-d805-4848-b164-4c156665e753', '522da116-24bf-4560-a32e-fe85e7a8f920', '998fe910-1666-48df-8293-3eab762a7bde', '2023-09-11 02:18:21', '2023-09-11 02:18:21'),
('94cd0eea-ad3a-45bc-94d7-4230e7c403c0', 'Cho thuê phòng giờ giấc tự do, tiện nghi 206/20 đường số 20 (Dương Quảng Hàm chạy vào)', '4', 'CAHV', 'Địa chỉ: 206/20 Đường số 20, Phường 5, Quận Gò Vấp, Hồ Chí Minh', 'e77ea8f8-cff1-4545-b04f-d6bf1acee4a4', 'CTPT', '[\"-Vị trí: Cuối đường số 20 Dương Quãng Hàm, rẻ phải (tòa nhà 5 lầu màu trắng). Gần trường Công nghiệp 4 (5 phút), Cao đẵng Bách Việt..Gần các khu giải trí cho các bạn thõa sức vui chơi như Gần bên CGV gò vấp cách bạn 10p đi xe dể dàng tận hưởng nhưng bộ phim bom tấn. 15p tới E-mart...\",\"-Thuận lợi đi lại cho các quận ( Bình Thạnh, Thủ Đức, Q.12,Tân Bình...)\",\"-Toàn bộ phòng được lót gạch men nên phòng trong rất sạch sẽ và cao ốc, Wc từng phòng.\",\"-Thang máy lên tới tận phòng.\",\"-Cửa kính thoáng mát,hướng ra bờ kè.\",\"-Có máy lạnh,nệm,tủ quần áo,kệ bếp\",\"-Có sân thượng,khu giặt được trang bị hệ thống máy giặt mới,\",\"-Có bảo vệ giữ xe, camera đảm bảo cho tài sản bạn được an toàn tuyệt đối.\",\"- GIỜ GIẤC TỰ DO\",\"Các chi phí\",\"Điện 4.000vnd/1kw\",\"Nước 50k 1 người / tháng\",\"Gửi xe máy ( xe số 100k 1 chiếc / tháng , xe tay ga 150k 1 chiếc / tháng)\",\"Dịch vụ 100k 1 người / tháng\",\"wifi 50k 1 người/ trên tháng\",\"-Nhanh tay gọi điện hoặc tới địa chỉ để đặt phòng thích hợp với mình\"]', '00d1f033-047a-4eeb-90ba-925a04191110', '193b33f2-f124-4fb9-90b3-3712de3c7884', '1af11870-76bc-4981-b80c-1be39e42e957', '2023-09-11 02:19:21', '2023-09-11 02:19:21');
