('960bc44b-0c3e-4254-8376-985e6b730596', 'KÝ TÚC XÁ ĐỦ MỌI TIỆN NGHI BAO ĐIỆN NƯỚC NGAY ĐẠI HỌC HUTECH QUẬN BÌNH THẠNH', '4', 'CBOH', 'Địa chỉ: 69/38 Đường D2, Phường 25, Quận Bình Thạnh, Hồ Chí Minh', '3b6d20d5-1f1d-4d72-adb8-df9ac329e052', 'CTPT', '[\"KÝ TÚC XÁ SIÊU TIỆN NGHI SAU ĐH HUTECH A-B CHỈ1TR8 TRỌN GÓI KHÔNG PHÁT SINH.\",\"Cơ sở 69/38/11 Nguyễn Gia Trí, Phường 25, Bình Thạnh.\",\"VỊ TRÍ:\",\"+ Cách đại học Hutech 200m.\",\"+ Cách đại học Ngoại Thương 300m.\",\"+ Cách Đại học Giao Thông Vận Tải 350m.\",\"+ Cách đại học Hồng Bàng, Đại Học UEF 500m.\",\"Giá Thuê: 1.800.000 (trọn gói không phát sinh).\",\"cọc 3tr hd 1 năm ( lưu ý chỉ nhận khách sinh viên và ký hd 1 năm )\",\"Mỗi phòng SLeep Box bao gồm:\",\"1, Phòng máy lạnh + quạt + quạt thông gió (sleep box có không gian riêng tư).\",\"2, Tủ quần áo (có khóa).\",\"3, Tủ đựng đồ + kệ sách (có khóa).\",\"4, Bàn học + đèn học.\",\"5, Nệm cao su + drap + rèm.\",\"KHU VỰC CHUNG:\",\"1, Bếp nấu rộng rãi.\",\"2, Có đầy đủ dụng cụ: Tủ Lạnh 600L + tủ đông Chén đũa Bếp điện xoong nồi nồi cơm - Lò vi sóng...\",\"3, Bàn ăn rộng rãi, trẻ trung (mỗi tầng có thêm 1 bàn ăn ngoài hành lang).\",\"4.Nước uống i-on miễn phí\",\"5. có khu máy giặt chung và sân phơi rộng rãi có mái che.\",\"6.cửa vân tay giờ giấc tự do\",\"-Mỗi phòng 8 box - 10 box\",\"-Xe máy gửi bãi xe gần nhà cách 50m giá 250k - 300k 1 chiếc/ tháng\",\"(Định mức điện mặc định là 50KWh/giường. Định mức điện tối thiểu là 300 KWh/ phòng và định mức điện tối đa là 500 KWh/ phòng),Giá điện khi vượt mức được tính 4000vnd/ 1kw, cộng lại chia đều cho tổng số người trong phòng.\",\"KHUYỄN MÃI THÁNG ĐẦU GIẢM 300K\"]', 'a2180508-95b7-4223-a601-6bca10000135', '62b489a4-d33b-4163-84bf-e98712c0c431', '37bd572d-fe65-4bd3-b923-a0a0561d9213', '2023-09-11 02:19:21', '2023-09-11 02:19:21'),
('9942d267-3504-4034-9de2-4b160f96a6f2', 'Cho thuê 2 tầng cửa hàng, văn phòng, mặt phố Yên Phụ, Tây Hồ, HN', '0', 'CNBN', 'Địa chỉ: An Dương, Phường Yên Phụ, Quận Tây Hồ, Hà Nội', 'df07b9b9-a018-4549-9573-d1456e5783c8', 'CTMB', '[\"Cần cho thuê 2 tầng (tầng 1, tầng 2) nhà mặt phố An Dương. Nhà xây mới, hiện đại, có thang máy phù hợp với văn phòng, cửa hàng trưng bày sản phẩm, lớp học, spa hoặc ngân hàng... Nhà nằm ở vị trí trung tâm Hà Nội, cách đường Thanh Niên 650m, đường trước nhà 6m, nằm trong khu dân trí cao.\",\"Diện tích sàn mỗi tầng là 110m², mặt tiền 6m, có gara để xe ô tô và xe máy.\",\"Ô tô đỗ cửa. Chủ thân thiện, dễ tính.\",\"Giá thỏa thuận.\",\" \"]', 'ddc09ed7-0246-4416-a320-4ce93158ee85', '8c7a81e6-853c-4946-a5aa-36872a4adbf2', 'e2590661-5754-42cf-b843-8a9178760877', '2023-09-11 02:18:21', '2023-09-11 02:18:21'),
('9fb1ff30-46ed-4f35-b030-c09805ffb43b', 'Cần Sang Nhượng Dãy Nhà Trọ,Sinh Viên Cao Cấp Ngay Đường Nguyễn Văn Hưởng Thảo Diền.TP Thủ Đức Q2.', '0', 'CNEH', 'Địa chỉ: 215 Đường Nguyễn Văn Hưởng, Phường Thảo Điền, Quận 2, Hồ Chí Minh', 'd64289c0-127a-42c1-9922-f37091ac5830', 'NCT', '[\"Sang dãy Nhà Trọ,Sinh Viên cao cấp ngay trung tâm Nguyễn Văn Hưởng Thải Điền.Q2 Chân Cầu sài gòn.\",\"- chỉ 2 phút ra Landmark 81.\",\"- 2 phút ra Hầm Thủ Thiêm. Qua quận 1.\",\"- Vị trí đắc địa, kính doanh thuận tiện.gần chợ, siêu thị trung tâm thương mại,Cantaview,Lotte,BigC, Landmark 81 ,trường học ngân hàng..vv\",\"Thông tin nhà như sau.\",\"- Nhà nằm đường rộng 2 chiều Nguyễn Văn Hưởng.\",\"-Diện tích nhà 5 x 20m.,diện tích phòng từ 30m2 đến 60m2,Tiện Nghi\",\"- kết cấu bao Gồm Trệt 3 lầu ,sân thượng 7Phòng, 7wc.Toàn bộ Máy lạnh, FULL NỘI THẤT.mặt bằng dưới để xe cho khách.\",\"- Tất cả các phòng đầy đủTiện Nghi, có bếp riêng từng phòng thoải mái sinh hoạt,mặt bằng dưới để xe,có hệ thống camera cửa khoá vân tay.an ninh tốt . Dân cư tri thức cao ,\",\"- Hiện tại đã cho thuê kín Full hết phòng.( HỢP ĐỒNG DÀI HẠN TỚI 6 NĂM ).Thu nhập hàng tháng trên 70triệu.lãi thu về sau khi trừ các tri phí còn là 30tr - 49tr/tháng.,lợi nhuận đều hàng tháng.giờ chỉ vào quản lý và thu tiền thôi.\",\"- Giá sang chỉ 580tr đã bao gồm tiền cọc chủ nhà.\",\"- Nay tôi cần sang nhượng lại tất cả hợp đồng và dich vụ kinh doanh.\",\"Địa chỉ Đường Nôi bộ Nguyễn Văn Hưởng ,Phường Thảo Điền. Quận 2.TPHCM\",\"LH: MR LUÂN CHÍNH CHỦ.0586 9999 68\",\"Cảm ơn các bạn đã đọc tin.!!\"]', '0bb1d317-061b-4dc6-a8bb-4290f55d52e6', 'a62f1cf8-6e89-4342-80d7-75e5af024841', '6356cf19-cb94-4203-a538-d357124e9c58', '2023-09-11 02:20:04', '2023-09-11 02:20:04'),
