('e3748000-c6f9-4b9a-9cb6-a6c54a6946d6', 'Mặt Bằng kinh doanh online, tạp hoá nhỏ,kho hàng có gác ở lại', '0', 'CNBN', 'Địa chỉ: 206/20 20, Phường 5, Quận Gò Vấp, Hồ Chí Minh', '54b70307-fc96-41ca-9550-1ee017db1463', 'CTMB', '[\"Mặt Bằng Gò Vấp gần phan văn trị,chợ gò vấp,phạm văn đồng\",\"-Mặt Bằng có phòng gác ở lại phù hợp kinh doanh online,tạp hoá nhỏ, làm kho .\",\"206/20 đường D20 , phường 5, Quận Gò Vấp. ( chạy dọc đường Dương Quảng Hàm rẻ vào D20)\",\"️Giá4tr/ tháng, cọc 1 tháng, hợp đồng1 năm\",\"Phòng cửa sổ hướng ra bờ sông rộng thoáng, đẹp view chill chill .\",\"Nội thất gồm có máy lạnh, nệm, tủ quần áo ,toilet riêng trong phòng.\",\"Máy giặt chung , sân thượng phơi đồ rộng thoáng, hầm để xe rộng!\",\"Ra vào cửa vân tay, thang máy, giờ giấc tự do , bảo vệ 24/24..\",\"Các chi phí\",\"Điện 4.000vnd/1kw\",\"Nước 50k 1 người / tháng\",\"Dịch vụ 100k 1 người / tháng\",\"wifi 50k 1 người/ trên tháng\",\"Liên hệ để được tư vấn và xem phòng trực tiếp : 0899455299 - 0974188183 (ALinh)\",\"Be Home - Đảm bảo môi trường sống tốt nhất dành cho bạn.\",\"------------\"]', 'b4e84b92-485f-4049-abd8-d5a69b400839', '50ddc6b1-46a8-4f2b-a795-dc5c87497d52', '33fdd02c-e6c1-409b-9a1f-decc44f3bb52', '2023-09-11 02:18:21', '2023-09-11 02:18:21'),
