('fd8a5a0c-3a4f-4dbc-b0ee-62b8612a6939', 'Chính chủ cho thuê CHDV QUẬN 1', '2', 'CUAN', 'Địa chỉ: 114/5 Đường Đề Thám, Phường Cầu Ông Lãnh, Quận 1, Hồ Chí Minh', '1ba88806-2df1-47bf-9c23-c6594a871024', 'CTCH', '[\"[PHÒNG TRỌ QUẬN 1 ]\",\"- Nhà mới xây nên rất mới, full nội thất, chỉ cần xách vali vào là ở.\",\"Đặc điểm của nhà:\",\"Full nội thất, toàn bộ nội thất được Andy\'Home sử dụng là nội thất cao cấp bao gồm (tủ lạnh, máy lạnh, máy nóng lạnh, tủ bếp, giường, nệm, bàn trang điểm, tủ quần áo,...)\",\"Nhà nằm ở vị trí gần đường chính Trần Hưng Đạo, Bùi Viện, ngay khu dân cư đông đúc, di chuyển qua Quận 1,4,10 trong một nốt nhạc️.\",\"Xung quanh là các ngân hàng, bệnh viện, khu mua sắm, hàng quán, tha hồ dạo phố, vui chơi.\",\"Chỉ với 5-10\' là bạn có thể đến các trường: Đại học Văn Lang, Đại học Kinh Tế, Đại học Công nghệ Sài Gòn, Cao đẳng Bách khoa Nam Sài Gòn, Huflit... Thuận tiện di chuyển cho các bạn sinh viên.\",\"Không chung chủ - ra vào tự do bằng thẻ từ hoặc dấu vân tay.\",\"An ninh, trật tự, có camera 24/24\",\"Miễn phí wifi, bãi đỗ xe rộng rãi, thoáng mát.\",\"-------------------------------------\",\"Địa chỉ: 114/5 Đề Thám, Phường Cầu Ông Lãnh, Quận 1, TP.HCM\",\"️ SĐT: 0981493640 (Thuý)\"]', '4fee387c-322d-45d3-892d-24ba718b6ad5', 'c81b1a02-7776-4932-ab5d-8475a6726958', 'b2b96162-ef79-44bd-b2ef-fb32f09dc3b2', '2023-09-11 02:17:44', '2023-09-11 02:17:44'),
('ff81687e-9efa-4ade-ab4b-b253e68d31fe', 'Cho Thuê Phòng Studio Full Nội Thất Bếp gần Etown Cộng Hoà (có cho thuê 1-3 tháng)', '0', 'CAHB', 'Địa chỉ: 31 Đường Tân Hải, Phường 13, Quận Tân Bình, Hồ Chí Minh', '489f0938-9641-4807-8bbd-47434341c727', 'CTCH', '[\"PHÒNG STUDIO FULL NỘI THẤT BẾP CAO CẤP 22m2. Đặc biệt có cho thuê ngắn hạn 1-3 tháng.Giá ưu đãi cho khách dài hạn.\",\"Địa chỉ: 31 Tân Hải,Phường 13,Q Tân Bình.\",\"(Tòa nhà 28 căn Studio cách Etown Cộng Hoà 100m)\",\"Lì xì đến 1 TRIỆU khi khách đặt phòng trong tháng 7/2023.\",\"+Giá từ 5,5Tr/Tháng (thuê từ 6 -12 tháng)\",\"+Giá từ 6,7Tr/Tháng (Thuê từ 1-3 tháng)\",\"* Toà nhà sang trọng an ninh bảo vệ 24/24,nội thất cao cấp, thang máy ( máy lạnh,tủ lạnh lớn,bếp,lò vi sóng,máy hút mùi,đồ dùng bếp … ).Trang thiết bị mới tiện nghi hơn khách sạn 3-4 sao.Quý khách chỉ xách vali vô ở.\",\"* ĐẶC BIỆT : có cho thuê ngắn hạn dành cho khách làm việc,công tác,Việt Kiều về thăm thân ….\",\"**Ngoài ra căn hộ còn có các căn Studio Đầy đủ Nội thất Đẹp:\",\"+ Phòng studio 24 m2 Giá từ : 6,9 tr/ tháng (có Bancony, View đẹp)\",\"+ Phòng studio 25 m2 Giá từ : 6,7 tr/ tháng ( Có Cứa Số Trời)\",\"+ Phòng studio 32 m2 Giá từ : 8,9 tr/ tháng (có Bancony, View đẹp)\",\"+ Phòng studio 35 m2 Giá từ : 7,9 tr/ tháng ( Có Cứa Số Trời)\",\"Có nhận hợp tác với các bạn Sale.\",\"*Ưu Đãi Đặc Biệt cho khách thuê dài hạn.\",\"RẤT HÂN HẠNH ĐƯỢC ĐÓN TIẾP QUÝ KHÁCH.\",\"ĐT: Chính Chủ 0906022702 chị Hương hoặc Zalo\"]', '2c6e1147-0c0e-48d9-bfab-597e1b835b26', '6a5c5c90-f596-489c-be6e-ecb73c3e50bf', '34634ac8-cb7d-46c3-bf0f-15bdbc3a2897', '2023-09-11 02:17:44', '2023-09-11 02:17:44');
